e win away from the lead at one point. In a season of 992 games it had come down to the second to last scheduled game to decide a winner between Roadrunner and Pelican. Would Roadrunner win back to back seasons and secure themselves as the clear leader of the league or would Pelican win the coveted 32 team season. Penguin lead the game 4-2 briefly in the second peroid, but Pelican scored 3 straight scoring the game winning goal at 12:29 in the 3rd and took season 20!", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (195, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 31, 39, 18, 0, 5, 83, 62, 192, 163, 21, 6, 0, 4, 46, 31, 18, 12, 0, 1, 37, 31, 1),(196, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 32, 38, 18, 0, 6, 82, 62, 195, 160, 18, 10, 0, 3, 39, 31, 20, 8, 0, 3, 43, 31, 2),(193, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 29, 35, 19, 0, 8, 78, 62, 205, 186, 19, 7, 0, 5, 43, 31, 16, 12, 0, 3, 35, 31, 3),(176, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 12, 36, 21, 0, 5, 77, 62, 192, 181, 16, 14, 0, 1, 33, 31, 20, 7, 0, 4, 44, 31, 4),(191, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 27, 37, 24, 0, 1, 75, 62, 168, 154, 18, 12, 0, 1, 37, 31, 19, 12, 0, 0, 38, 31, 5),(187, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 23, 36, 24, 0, 2, 74, 62, 191, 148, 21, 10, 0, 0, 42, 31, 15, 14, 0, 2, 32, 31, 6),(183, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 19, 35, 24, 0, 3, 73, 62, 180, 163, 21, 9, 0, 1, 43, 31, 14, 15, 0, 2, 30, 31, 7),(177, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 13, 34, 23, 0, 5, 73, 62, 180, 174, 21, 7, 0, 3, 45, 31, 13, 16, 0, 2, 28, 31, 8),(168, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 4, 33, 22, 0, 7, 73, 62, 187, 161, 16, 10, 0, 5, 37, 31, 17, 12, 0, 2, 36, 31, 9),(178, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 14, 34, 24, 0, 4, 72, 62, 157, 166, 20, 9, 0, 2, 42, 31, 14, 15, 0, 2, 30, 31, 10),(173, "2022-11-25 18:29:41.0", "2022-12-09 20:49:1